import React from 'react';
import {
    BrowserRouter as Router,
    Switch,
    Route
    } from 'react-router-dom';

import Index from './components/pages/Index/Index';
import Login from './components/pages/Login/Login';
import Register from './components/pages/Login/Register';
import Dashboard from './components/Dashboard/Dashboard';
import ForgotPassword from './components/pages/Login/ForgotPassword';
import ResetPassword from './components/pages/Login/ResetPassword';
import ConfirmEmail from './components/pages/Login/ConfirmEmail';
import Logout from './components/pages/Login/Logout';
import Refresh from './components/pages/Login/Refresh';


function Routes() {
    return (
        <Router>
            <Switch>
                <Route exact path="/">
                    <Index />
                </Route>
                <Route path="/login">
                    <Login />
                </Route>
                <Route path="/register">
                    <Register />
                </Route>
                <Route path="/verify">
                    <ConfirmEmail />
                </Route>
                <Route path="/forgot_pass">
                    <ForgotPassword />
                </Route>
                <Route path="/reset_pass">
                    <ResetPassword />
                </Route>
                <Route path="/refresh">
                    <Refresh />
                </Route>
                <Route path={["/home", "/motivation", "/explore", "/lessons", "/lesson", "/account", "/logout"]}>
                    <Dashboard />
                </Route>
            </Switch>
        </Router>
    );
}

export default Routes;
